(849, 'id_questiontext', 87, 'dd210d94f1a437af13a3794c9e4b2440bf2e81f7', 2, '<p>\n\n</p><p><span lang="EN-US">What is the\noutput of this program?</span></p><p><strong>\n\n</strong>\n\n</p><p><b><span lang="EN-US">class</span></b><span lang="EN-US"> box </span><span lang="EN-US">{</span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><b><span lang="EN-US">int</span></b><span lang="EN-US"> width</span><span lang="EN-US">;</span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><b><span lang="EN-US">int</span></b><span lang="EN-US"> height</span><span lang="EN-US">;</span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><b><span lang="EN-US">int</span></b><span lang="EN-US"> length</span><span lang="EN-US">;</span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp; </span><span lang="EN-US">}</span><span lang="EN-US"> </span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp; </span><b><span lang="EN-US">class</span></b><span lang="EN-US"> mainclass </span><span lang="EN-US">{</span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><b><span lang="EN-US">public</span></b><span lang="EN-US"> </span><b><span lang="EN-US">static</span></b><span lang="EN-US"> </span><b><span lang="EN-US">void</span></b><span lang="EN-US"> main</span><span lang="EN-US">(</span><span lang="EN-US">String</span><span lang="EN-US"> args</span><span lang="EN-US">[])</span><span lang="EN-US"> </span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span lang="EN-US">{</span><span lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p><p>\n\n</p><p><span lang="EN-US">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; box obj </span><span lang="EN-US">=</span><span lang="EN-US"> </span><b><span lang="EN-US">new</span></b><span lang="EN-US"> box</span><span lang="EN-US">()</span><span lang="EN-US">;</span></p><p>\