(4, 2, 1, 'deferredfeedback', 1, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these operators can be used to concatenate two or more String objects?\n\n: +\n\n; +=\n\n; &\n\n; ||\n\n', '+\n\n', '+\n\n', 1489813346),
