(8, 3, 2, 'deferredfeedback', 5, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these modifiers can be used for a variable so that it can be accessed from any thread or parts of a program?\n\n: Global\n\n; Volatile\n\n; Transient\n\n; No modifier is needed\n\n', 'Volatile\n\n', 'Transient\n\n', 1489815018),
